import React from "react";
import "./button.css";

const Button = () => {
  return (
    <a className="fancy">
      <span className="top-key" />
      <span className="text">Buy Tickets</span>
      <span className="bottom-key-1" />
      <span className="bottom-key-2" />
    </a>
  );
};

export default Button;
